import ReactDom from 'react-dom';
import Cards from './Cards';
import Sdata from './Sdata';

function nCard(val) {
    return ( <
        Cards imgsrc = {
            val.imgsrc
        }
        title = {
            val.title
        }
        sname = {
            val.sname
        }
        link = {
            val.link
        }
        />
    );

}


ReactDom.render(



        Sdata.map(nCard)
    ,

    document.getElementById('root')

);
